import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { Link } from "react-router-dom";
import { Home } from "./components/Home";
import { Films } from "./components/Films";
import { People } from "./components/People";
import { Planets } from "./components/Planets";
import { Species } from "./components/Species";
import { Starships } from "./components/Starships";
import { Vehicles } from "./components/Vehicles";
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import {Navbar, Nav, NavDropdown, Form, FormControl, Button} from 'react-bootstrap';
import uuid from 'uuidv4';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isClacked: false
    };
  }

  componentDidMount() {
    this.mounted = true;
}

componentWillUnmount() {
  this.mounted = false;
}

  render() {
    return (
      <Router>
     <Navbar bg="light" expand="lg">
  <Navbar.Brand href="/">React-Bootstrap</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Link to="/" className="nav-link">
          Home
      </Link>
      <Link to="/films" className="nav-link">
          Films
      </Link>
      <Link to="/people" className="nav-link">
          People
      </Link>
      <Link to="/planets" className="nav-link">
          Planets
      </Link>
      <Link to="/species" className="nav-link">
          Species
      </Link>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar.Collapse>
</Navbar>
        <div className="container fill">
          <ul className="nav">
            <li className="nav-item" >
              <Link to="/" className="nav-link">
                Home
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/films" className="nav-link">
                Films
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/people" className="nav-link">
                People
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/planets" className="nav-link">
                Planets
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/species" className="nav-link">
                Species
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/starships" className="nav-link">
                Starships
              </Link>
            </li>
            <li className="nav-item" >
              <Link to="/vehicles" className="nav-link">
                Vehicles
              </Link>
            </li>
          </ul>

          <Route path="/" component={Home} exact  key={uuid()}/>

          <Route path="/films" component={Films} key={uuid()}/>

          <Route path="/people" component={People} key={uuid()}/>

          <Route path="/planets" component={Planets} key={uuid()}/>

          <Route path="/species" component={Species} key={uuid()}/>

          <Route path="/starships" component={Starships} key={uuid()}/>

          <Route path="/vehicles" component={Vehicles} key={uuid()}/>
        </div>
      </Router>
    );
  }
}
